        "description": "¡Menuda noche vivimos con LOS40 Music Awards 2022! Otro año más, nos volvimos a superar con los premios más importantes de la música en España. El pasado viernes, 4 de noviembre, el WiZink Center de Madrid se llenó de estrellas. Revive los mejores momentos en vídeo.  \n\nLa gran fiesta de la música de nuestro país acogió a una larga lista de artistas para celebrar un año lleno de éxitos. Rosalía, David Guetta, Anitta, Yungblud, Ava Max, Aitana, Ana Mena, Sebastián Yatra, Lola Índigo, Chanel, Morat, Leiva, Manuel Carrasco, María Becerra, Manuel Turizo, Tiago PZK, Juanes, Dani Fernández, Danny Ocean, Marc Seguí, Abraham Mateo, Leo Rizzi y Sangiovanni se subieron al escenario para hacernos vibrar con su música, regalándonos unas actuaciones que ya forman parte de nuestra historia.  \n\nAdemás, durante la gala fuimos testigos de grandes momentazos sobre el escenario: desde la transformación en Cenicienta de Ana Mena a la coreografía de Aitana, pasando por la primera actuación de Toke en directo de Chanel. También nos emocionamos con discursos como el de Dani Fernández, Lola Índigo o Pedro Almodóvar. \n\nPor supuesto, también tenemos que hablar de los momentos virales: desde ese perreo de Anita a Isabel Díaz Ayuso al momento de Yungblud bailando en la mesa de Belén Esteban. Sin duda, una noche mágica que nunca olvidaremos.  \n\nSi quieres música y entretenimiento, cine y TV, curiosidades, bromas o juegos y challenges con los artistas del momento, no olvides suscribirte a nuestro canal: http://www.youtube.com/subscription_center?add_user=los40principales\n\nTambién estamos en tu móvil 📲 Descárgate la APP de LOS40: http://onelink.to/los40app \n\n🎤🎤🎤🎤🎤🎤🎤🎤🎤🎤🎤🎤🎤🎤🎤🎤 \n\nNuestras redes sociales:  \n\nhttp://instagram.com/los40spain \nhttps://twitter.com/Los40 \nhttps://www.facebook.com/los40/ \nhttps://www.tiktok.com/@los40spain\n\n📻 📻 📻 📻 📻 📻 📻 📻 📻 📻 📻 📻 📻 \n\n* Escucha la radio más global y con los éxitos del momento: https://play.los40.com/ \n* Consul